import React from "react";
export default function Destinasi() {
  return (
    <div className="container mt-6 space-y-3">
      <h1 className="text-2xl font-bold">Destinasi</h1>
      <p className="text-slate-600 dark:text-slate-300">Daftar destinasi populer Nusa Penida akan diisi/dikustom lewat menu Admin & Supabase.</p>
    </div>
  );
}
